webpackJsonp([0xbc508f5b1ab0],{608:function(o,n){o.exports={data:{markdownRemark:{html:"<p>What do you do\nWhen the stem of the crown\nHasn't a clue\nDo you follow em' down?</p>\n<p>Cuz' its painful to prance\nOn rickety ground\nBut, take it for me\nDont follow em' down</p>\n<p>When what you believe\nWould grieve the chief of the crowd\nAnd, you crave for their charm\nWill you follow em' down</p>\n<p>Mirrors of words\nSurely could purchase their vow\nBut take it for me\nDon't follow em' down</p>\n<p>Near the winding whiskey river\nDiving ducks can be found\nDo you cut in their line?\nDo you follow em' down?</p>\n<p>I stood at the edge\nBy a rodeo clown\nHe cackled and said\nWhy follow em' down?</p>\n<p>When you man has to run\nFrom the heat of the town\nAnd he calls for his shoes\nDo you follow him down?</p>\n<p>Well, he's too young to die\nBut, seems ancient somehow\nSo, wave him goodbye\nDon't follow him down</p>\n<p>What do you do?\nWhen the stem of the crown\nHasn't a clue\nDon't follow em' down</p>",frontmatter:{title:"Don't Follow Em' Down"},fields:{date:null}}},pathContext:{slug:"/songs/dont-follow-em-down/"}}}});
